import React, { Component } from "react";

class Trivia extends Component {
  constructor(props) {
    super();
    this.state = {
      questions: [...props.questions],
      next: 0,
    };
  }

  render() {
    return <div className="flex flex-col"></div>;
  }
}

export default Trivia;
